import React from 'react';
import './Signup.css';


export const signup = (props) => { 
    return (
        <div className="signup">
         <h1> {props.field}</h1>
         <input type={props.type} onChange={props.changed} onClick={props.click}/> 
        </div>
       
    );

}
export const signupSuccessful = () => { 
    return (
        <div className="signup">
         <p>Signed Up succcessfully!!!</p>
        </div>
       
    );

}

export const signupUnsuccessful = () => { 
    return (
        <div className="signup">
         <p>Invalid Credentials, redo it!!</p>
        </div>
       
    );

}
